import { BsFillBackspaceFill } from "react-icons/bs";

const Movie = ({ movie }) => {
  return (
    <div className="bg-warning rounded m-2">
      <h4 className="p-3">
        {movie.name}
        {movie.priority === true && (
          <span className="text-danger font-weight-bold"> **</span>
        )}
        <> </>
        <BsFillBackspaceFill />
      </h4>
    </div>
  );
};

export default Movie;
